import './css/main-unlogged.css';
import './css/public-nav.css';
import PublicNavBar from './components/public-nav';
import { Route, Link, BrowserRouter as Router } from 'react-router-dom';

import Home from '//index-app.js'
import Faq from '//faq-app.js'

function Support() {
    return (
        <div className="App">
            <Router>
                <PublicNavBar />
            </Router>
            <Route path="/" exact component={Home} />
            <Route path="/soporte" component={Support} />
            <Route path="/preguntas-frecuentes" component={Faq} />
        </div>
    );
}

export default Support;
